import React, { useState } from 'react'

const Home = () => {
    options=[
        {
            id:1,
            user:admin
        },
        {
            id:2,
            user:""
        },
        {
            id:3,
            user:admin
        },
        {
            id:4,
            user:admin
        }
    ];

    const [choice,setChoice]=useState();
    console.log(choice);
    return (
        <div>
          <select onChange={(cho)=>setChoice(cho)}>
              {
                  options.map((ele)=>{
                    <option value={ele.user}>ele.user</option>
                  })
              }
          </select>  
        </div>
    )
}

export default Home
